            </section>

            <section class="py-8 px-4 max-w-4xl mx-auto">
                <div class="bg-transparent rounded-md p-6">
                    <form id="profileForm" class="space-y-3">
                        <!-- Full Name -->
                        <div class="w-full">
                            <label for="fullName" class="block text-sm font-medium text-gray-700 mb-1">Full Name</label>
                            <input type="text" id="fullName" name="fullName" class="w-full px-3 py-2 border border-teal rounded focus:outline-none focus:ring-2 focus:ring-teal">
                        </div>

                        <!-- Address -->
                        <div class="w-full">
                            <label for="address" class="block text-sm font-medium text-gray-700 mb-1">Address</label>
                            <input type="text" id="address" name="address" class="w-full px-3 py-2 border border-teal rounded focus:outline-none focus:ring-2 focus:ring-teal">
                        </div>
                        <!-- Age and Sex in a row -->
                        <div class="flex flex-wrap gap-4">
                            <!-- Age -->
                            <div class="w-full sm:w-1/4">
                                <label for="age" class="block text-sm font-medium text-gray-700 mb-1">Age</label>
                                <input type="number" id="age" name="age" class="w-full px-3 py-2 border border-teal rounded-md focus:outline-none focus:ring-2 focus:ring-teal text-center">
                            </div>

                            <!-- Sex -->
                            <div class="w-1/4 sm:w-2/3">
                                <label class="block text-sm font-medium text-gray-700 mb-1">Sex</label>
                                <div class="flex border border-teal rounded-md overflow-hidden">
                                    <label class="inline-flex items-center px-3 py-2 flex-1 cursor-pointer">
                                        <input type="radio" name="sex" value="male" class="w-4 h-4 text-[#199B91] border-gray-300 focus:ring-[#199B91]">
                                        <span class="ml-2 text-sm text-gray-700">Male</span>
                                    </label>
                                    <div class="w-px h-full bg-gray-300"></div>
                                    <label class="inline-flex items-center px-3 py-2 flex-1 cursor-pointer">
                                        <input type="radio" name="sex" value="female" class="w-4 h-4 text-[#199B91] border-gray-300 focus:ring-[#199B91]">
                                        <span class="ml-2 text-sm text-gray-700">Female</span>
                                    </label>
                                </div>
                            </div>
                        </div>

                        <!-- Height and Weight in a row -->
                        <div class="flex flex-wrap gap-25">
                            <!-- Height -->
                            <div class="w-full sm:w-1/4">
                                <label for="height" class="block text-sm font-medium text-gray-700 mb-1">Height</label>
                                <div class="flex items-center">
                                    <input type="number" id="height" name="height" class="w-24 px-3 py-2 border border-teal rounded-l focus:outline-none focus:ring-2 focus:ring-teal text-center" placeholder="175">
                                    <span class="px-3 py-2 bg-gray-100 border border-l-0 border-teal rounded-r text-gray-500">cm</span>
                                </div>
                            </div>
                            <!-- Weight -->
                            <div class="w-full sm:w-1/4">
                                <label for="weight" class="block text-sm font-medium text-gray-700 mb-1">Weight</label>
                                <div class="flex items-center">
                                    <input type="number" id="weight" name="weight" class="w-24 px-3 py-2 border border-teal rounded-l focus:outline-none focus:ring-2 focus:ring-teal text-center" placeholder="70">
                                    <span class="px-3 py-2 bg-gray-100 border border-l-0 border-teal rounded-r text-gray-500">kg</span>
                                </div>
                            </div>
                        </div>

                        <div class="pt-4 flex justify-center">
                            <button type="submit" class="w-80 text-xl font-bold px-8 py-3 bg-teal text-white rounded-full hover:bg-teal-700 focus:outline-none focus:ring-2 focus:ring-teal-500">
                                WELCOME
                            </button>
                        </div>
                    </form>
                </div>
            </section>

        </div>
    </div>
</body>
</html>
